Ronald Firbank (1886-1926) was an acclaimed British novelist whose work was championed by E. M. Forster and Evelyn Waugh. He attended Trinity Hall, Cambridge, although he left before receiving a degree. He traveled extensively through Spain, Italy, the Middle East, and North Africa. He died of lung disease while in Rome in 1926.


The torrent contains following books in PDF and epub format:

The Flower Beneath The Foot - Being a Record of the Early Life of St. Laura De Nazianzi and the Times in which She Lived (novel, 1923)

Sorrow in Sunlight (published in the U.S.A. as Prancing Nigger; novel, 1924)

Concerning the Eccentricities of Cardinal Pirelli (novel, 1926)

